import React, { useEffect, useState } from 'react';
import { useQuery } from 'react-apollo-hooks';
import { fbQuery } from '../queries/queries';
import { Item, MasterDetail } from './MasterDetail';
export const GitHubList: React.FC = () => {

  interface node{
    createdAt:string,
    name:string,
    url:string

  }

  const {data,loading,error}=useQuery(fbQuery)
  const [fbList,setfbList]=useState<node[]>([]);
  useEffect(()=>{
data && setfbList(data.search.edges)
  },[data])

  return <MasterDetail>
    {[fbList.map(child=><Item payload={``}>{child.name}</Item>),<Detail>{(payload) => payload.content}</Detail>].map(child=>child)}
  </MasterDetail>
};
